    <div className="w-50">
      <h3 className="display-4">Sign Up</h3>
      <Formik
        initialValues={{
          firstName: "test",
        }}
      >
        <Form>
          <Row>
            <Col>
              {/* <Field name="firstName" component={InputControl} /> */}
              <InputControl />
            </Col>
            <Col>
              <Field name="lastName" />
            </Col>
          </Row>
        </Form>
      </Formik>
    </div>
  );
};

const InputControl = ({ label, ...props }) => (
  <Form.Group>
    <Form.Label>{label}</Form.Label>
    <Form.Control {...props} />
  </Form.Group>
);

